<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Nav Bar</title>
    <Style>

        .logo img{
            width: 30px;
            
        }

        .end-image img{
            height: 30px;
            justify-content: center;
        }
        nav{
            display: flex;
            justify-content: space-around;
            align-items: center;
        }

        .element ul{
            align-items: center;
            display: flex;
            gap: 15px;
            
        }
        .element ul li{
            list-style: none
        
        }


    </Style>
</head>
<body>
    <header>
        <nav>
            <div class="logo">
                <img src="https://static.vecteezy.com/system/resources/previews/035/770/750/large_2x/number-69-letter-logo-icon-designs-vector.jpg" alt="69 logo">
            </div>

            <div class="element"> 
                <ul>
                    <li><span>Products</span></li> 
                    <li>Pricing</li>
                    <li>Resources</li>
                    <li>About Us</li>
                    <li class="end-image"><img src="https://media.istockphoto.com/id/831648336/vector/translate-icon-vector-translation-from-japanese-to-english-flat-icon.jpg?s=612x612&w=0&k=20&c=EArygXGP2icnbN8JTe4t2ajifXp6ay8zODYLAE6AnWw=" alt=""></li>
                </ul>
                <svg class=""></svg>
            </div>
        </nav>
    </header>
    
</body>
</html>
